class Solution(object):
    def __init__(self):
        pass
    
    def numIslands(self, grid):
        """
        :type grid: List[List[str]]
        :rtype: int
        """
        self.visited = set()
        count = 0
        for i in range(len(grid)):
            tmp =  set(grid[i])
            if len(tmp) == 1 and "0" in tmp:
                continue
            for j in range(len(grid[0])):
                if (i,j) not in self.visited and grid[i][j] == '1':
                    self.visited.add((i,j))
                    self.dfs((i,j), grid)
                    count += 1
        
        return count
        
    def dfs(self, node, grid):
        myStack = [node]
        while myStack:
            curr = myStack.pop()
            
            child1 = (curr[0] + 1, curr[1])
            child2 = (curr[0] - 1, curr[1])
            child3 = (curr[0], curr[1] + 1)
            child4 = (curr[0], curr[1] - 1)
            
            if child1[0] >=0 and child1[0] < len(grid) and child1[1] >=0 and child1[1] < len(grid[0]) and grid[child1[0]][child1[1]] == '1' and child1 not in self.visited:
                self.visited.add(child1)
                myStack.append(child1)
            
            if child2[0] >=0 and child2[0] < len(grid) and child2[1] >=0 and child2[1] < len(grid[0]) and grid[child2[0]][child2[1]] == '1' and child2 not in self.visited:
                self.visited.add(child2)
                myStack.append(child2)
                
            if child3[0] >=0 and child3[0] < len(grid) and child3[1] >=0 and child3[1] < len(grid[0]) and grid[child3[0]][child3[1]] == '1' and child3 not in self.visited:
                self.visited.add(child3)
                myStack.append(child3)
            
            if child4[0] >=0 and child4[0] < len(grid) and child4[1] >=0 and child4[1] < len(grid[0]) and grid[child4[0]][child4[1]] == '1' and child4 not in self.visited:
                self.visited.add(child4)
                myStack.append(child4)
            
        
        

